/**
 * Returns the icon object for the given name.
 * Returns a Promise resolving to { path } for known icons.
 * Returns a Promise resolving to { path: "" } for unknown icons
 * so HA never receives null and crashes on .path access.
 * @param {string} name - Icon name without the "redsea:" prefix
 * @returns {Promise<{ path: string }>}
 */
async function getIcon(name) {
  const path = ICONS[name];
  return { path: path ?? "" };
}

/**
 * Returns the list of all available icon names (used by HA icon picker).
 * @returns {Promise<Array<{ name: string }>>}
 */
async function getIconList() {
  return Object.keys(ICONS).map((name) => ({ name }));
}

// Register with both APIs for maximum compatibility:
// - window.customIconsets: legacy API (HA < 2021.11)
// - window.customIcons:    modern API with icon picker support
window.customIconsets = window.customIconsets ?? {};
window.customIconsets["redsea"] = getIcon;

window.customIcons = window.customIcons ?? {};
window.customIcons["redsea"] = { getIcon, getIconList };
